void interval_timer_ISR(void){
    *(interval_timer_ptr) = 0;

    timeRemaining -= 1;

    draw_timer(timeRemaining, 1); // Clear current time
    draw_timer(timeRemaining, 0); // Draw updated time

    wait_for_vsync();
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);

    if(timeRemaining == 0 && (playerScore < targetScore)){
        draw_screen(loser_screen);
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);

        // delay loop, a billion or trillion will do

        draw_screen(crdeits_screen); // Should be an animation

        draw_screen(start_screen);
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);

        pause = 0;

        return;
    }else if (timeRemaining == 0){
        draw_screen(winner_screen);
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);

        // delay loop, a billion or trillion will do

        draw_screen(crdeits_screen); // Should be an animation

        draw_screen(start_screen);
        wait_for_vsync();
        pixel_buffer_start = *(pixel_ctrl_ptr + 1);

        pause = 0;

        return;
    }else{
        return;
    }
    
}

void clear_ps2_fifo(int PS2_data_reg){
	PS2_data_reg = *ps2_ptr & 0xFFFF80FF;
	int RI_field = *(ps2_ptr+1) & 0x00000100;

    // Poll and continously read from PS/2 data register until RI field in PS/2 control register is zero
    while(RI_field != 0){
        PS2_data_reg = *ps2_ptr & 0xFFFF80FF;
		RI_field = *(ps2_ptr+1) & 0x00000100;
    }
}


