void swap_fruit(struct fruit* f1, struct fruit* f2){
    // Store f1 xy coord in temporary variables
    int temp_x = f1->x_pos, temp_y = f1->y_pos;

    // Copy xy coord of f2 into f1
    f1->x_pos = f2->x_pos;
    f1->y_pos = f2->y_pos;

    //Copy xy coord of temp (prev. f1) into f2
    f2->x_pos = temp_x;
    f2->y_pos = temp_y;
}

