int compareCoordinates(const void *a, const void *b) {
    struct fruit *f1 = *(struct fruit **)a;
    struct fruit *f2 = *(struct fruit **)b;

    // Sort by x coordinate first, then y coordinate
    if (f1->x_pos != f2->x_pos) {
        return f1->x_pos - f2->x_pos;
    } else {
        return f1->y_pos - f2->y_pos;
    }
}

void sort_GMBrd(struct fruit* GMBrd[][BOARD_WIDTH]){
    // Flatten the 2D array into a 1D array for sorting
    struct fruit *flatGrid[BOARD_LENGTH * BOARD_WIDTH];
    int index = 0;
    for (int i = 0; i < BOARD_LENGTH; i++) {
        for (int j = 0; j < BOARD_WIDTH; j++) {
            flatGrid[index++] = GMBrd[i][j];
        }
    }

    // Sort the flattened array using custom comparison function
    qsort(flatGrid, BOARD_LENGTH * BOARD_WIDTH, sizeof(struct fruit *), compareCoordinates);

    // Place the sorted pointers back into the grid
    index = 0;
    for (int i = 0; i < BOARD_LENGTH; i++) {
        for (int j = 0; j < BOARD_WIDTH; j++) {
            GMBrd[i][j] = flatGrid[index++];
        }
    }
}

